script: |
  super -f tsv -I q24.sql | sort > q24.out

vector: true

inputs:
  - name: q24.sql
    data: |
      SELECT - col1 + - 68 / + - col0 AS col0 FROM tab1 AS cor0 WHERE + col2 * - 89 + - col2 NOT IN ( - - col2 * - col1 - + col0 + + - col1 + - col2, + col1 );
  - name: tab1

outputs:
  - name: q24.out
    data: |
      -13
      -47
      -5
